import React from "react";

const Data = (props) => {
  const { totalSaleAmount, totalSoldItems, totalNotSoldItems } = props;
  return (
    <>
      <h1>Total Sale Amount: {totalSaleAmount}</h1>
      <h1>Total Sold Items: {totalSoldItems}</h1>
      <h1>Total Not Sold Items: {totalNotSoldItems}</h1>
    </>
  );
};

export default Data;
